INSERT INTO `cc_program` (`cc_id`, `cc_detail`, `cc_desc`, `cc_tujuan`, `cc_time`, `last_modified`, `status`, `start_month`, `end_month`) VALUES
(1, 'BERIMAN (BERsih, RapI dan nyaMAN)', 'Program budaya yang menjadi wadah bagi seluruh pegawai BANK JATIM untuk mengatur atau mengelola tempat kerja menjadi tempat kerja yang lebih nyaman, produktif, dan menyenangkan serta pembiasaan untuk NO PENDING BEHAVIOR', 'Menumbuhkan perilaku Agile & Business Savvy dan Collaboration  Memberikan nilai tambah berupa peningkatan kualitas dan reputasi perusahaan', 5, '2019-02-27 05:12:37', 'Default', '2019-07-22', '2019-12-31'),
(3, 'Everyday is SELASA (SEnyum, SaLAm, SApa)', 'Memberikan nilai tambah berupa peningkatan kepuasan pelanggan dan terbangunnya iklim kerja yang lebih terbuka\n', 'Menumbuhkan perilaku Trust dan Respect -  Memberikan nilai tambah berupa peningkatan kepuasan pelanggan dan terbangunnya iklim kerja yang lebih terbuka', 5, '2019-02-28 01:16:29', 'Default', '2019-07-22', '2019-12-31'),
(7, 'OK BRO (Orang Keren BeRani Ontime)', 'Program budaya untk menumbuhkan budaya tepat waktu  dalam hal kehadiran pagi dan rapat\n', 'Menumbuhkan perilaku Proactive & Accountability dan Respect - Memberikan nilai tambah berupa peningkatan kedisiplinan dan produktifitas pegawai', 10, '2019-02-28 01:44:48', 'Default', '2019-02-22', '2019-12-31'),
(8, 'SICOMO (aSIk COffe MOrning)', 'Program ini mengedepankan inisiatif dan keproaktifan pegawai dalam belajar, sharing pengetahuan, menyampaikan pesan-pesan penting manajemen, nilai-nilai budaya, saling memotivasi, saling memberikan apresiasi tertentu dan diskusi  untuk meningkatkan hubungan interpersonal pegawai yang mendukung pencapaian target unit kerja', 'Menumbuhkan perilaku Eager to Learn dan Creativity - Memberikan nilai tambah berupa percepatan proses dan terbangunnya iklim kerja yang lebih terbuka', 5, '2019-02-28 01:45:12', 'Default', '2019-07-22', '2019-12-31');
